  \"2016-08-04T08:17:20.098286\",\n\t\"name\": \"quarterly-narrative-report-of-the-aleutian-islands-national-wildlife-refuge-for-the-period\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Aleutian Islands
  NWR outlines Refuge accomplishments during 1953. The report begins by summarizing
  the weather conditions and water conditions during this period. Wildlife- including
  migratory birds, upland game birds, big game animals, raptors, and fish- is also
  covered. The Refuge development and maintenance section discusses physical developments
  and wildfires. A progress report on field investigations and applied research is
  also provided. The public relations section of the report describes recreational
  uses, hunting, and fishing.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
